import logo from './logo.svg';
import './App.css';
import Post from './Post.js';
import React from 'react';

class App extends React.Component {
  fill() {
    var posts = [];

    var post;
    post.userID = "userID1";
    post.id = "id1";
    post.title = "title1";
    post.body = "body1";

    posts.push(post);

    post.userID = "userID2";
    post.id = "id2";
    post.title = "title2";
    post.body = "body2";

    posts.push(post);
    this.setState({posts: posts});
  }

  constructor(){
    super();
    this.state = {
      posts: []
    };
  }

  render() {
    this.fill();
    return (
      <div className="body">
      <h1>List of posts</h1>
      {this.state.posts.map((item) => (
        <Post post={item}/>
      ))}
      </div>
    );
  }
}

export default App;
